import { MultiSelect } from "react-multi-select-component";
import { useState } from "react";
import './index.css';


const options = [
    { label: "Gewerbe", value: "Gewerbe" },
    { label: "Kaderkonferenz alle", value: "Kaderkonferenz alle" },
    { label: "Koordinationssitzung", value: "Koordinationssitzung"},
  ];
  
  const DistributionList = (props) => {
    const [selectedDistributionLists, setSelectedDistributionLists] = useState([]);
  
    return (
      <div className="form-control">
        <MultiSelect
          options={options}
          value={selectedDistributionLists}
          onChange={setSelectedDistributionLists}
        />
      </div>
    );
  };
  
export default DistributionList;
